import React from "react";
import {useNavigate } from 'react-router-dom'
 
import "./Home.css";
function Home() {
  const navigate = useNavigate();
  
  return (
      <>
      <div className="container">
        <input type="text" className="search mt-5" placeholder="search . . ."/>
        <button type="button" class="btn btn-warning ms-2 mb-2">Search</button>
        <button type="button" class="btn btn-primary ms-2 mb-2 " onClick={AddTodo()}>Add
        </button>
      </div>
    </>
  );
}

export default Home;
